import './App.css';
import 'antd/dist/antd.css';
import FirstScreen from './screens/js/firstScreen';
import logo from "./assets/logo.jpg";

function App() {
  return (
    <div className="App">

      <img src={logo} alt="exmp" />
      <h1 id='logo'>Singit</h1>
      <FirstScreen></FirstScreen>
    </div>
  );
}

export default App;
